import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import hackat from '../images/hackat.png';

function Certificate() {
	const[showImage, setShowImg] = useState("visible")
	return (
		<div id="certify" className="img-certify row" style={{visibility: showImage}}>
			<div col-12>
				<img className="img-preview " src={hackat} alt="certificate" />

					<Link to="pro-id"><button>Projects</button></Link> 

			</div>
		</div>
	);
}
export default Certificate;
